def calculate_min_break_cost(n, m, k):
    d = [[[0 for _ in range(51)] for _ in range(31)] for _ in range(31)]

    def rec(n, m, k):
        nonlocal d
        if n * m == k and k == 0:
            return 0
        if d[n][m][k] > 0:
            return d[n][m][k]
        if n * m < k:
            return 10 ** 10
        cost = 10 ** 10
        for i in range(1, n // 2 + 1):
            for j in range(k + 1):
                cost = min(cost, m * m + rec(n - i, m, k - j) + rec(i, m, j))
        for i in range(1, m // 2 + 1):
            for j in range(k + 1):
                cost = min(cost, n * n + rec(n, m - i, k - j) + rec(n, i, j))
        d[n][m][k] = cost
        return cost
    return rec(n, m, k)

